In general ZomboDB uses the equivalent of Postgres' to_json() function to convert individual columns to JSON when indexing. However, ZomboDB does provide the ability to provide custom json conversion functions for any data type, and it installs custom conversion functions for Postgres' point type along with PostGIS' geometry and geography types. FUNCTION zdb.define_type_conversion( typeoid regtype, funcoid regproc) RETURNS void If you have a custom datatype that you need to convert to json, you need to make a conversion function that takes a single argument that is the type you wish to convert and returns json. Then you'll call this function to associate your type with your conversion function. You'll also need to define a custom type mapping using zdb.define_type_mapping() (see above). An example might be: CREATE TYPE example AS ( title varchar(255), description text
); -- custom json conversion function
CREATE OR REPLACE FUNCTION example_type_to_json(example) RETURNS json IMMUTABLE STRICT LANGUAGE sql AS $$ SELECT json_build_object('title', $1.title, 'description', $1.description);
