ZomboDB automatically indexes fields of type json as "nested objects". The boolean operator WITH allows forming queries that match on individual nested objects. For example, if you have a field named contributor_data with a few values such as: row #1: [ { "name": "John Doe", "age": 42, "location": "TX", "tags": ["active"] }, { "name": "Jane Doe", "age": 36, "location": "TX", "tags": ["nice"] }
] row #2: [ { "name": "Bob Dole", "age": 92, "location": "KS", "tags": ["nice", "politician"] }, { "name": "Elizabth Dole", "age": 79, "location": "KS", "tags": ["nice"] }
] To find all top-level documents whose contributors are in TX and are nice: contributor_data.location:TX AND contributor_data.tags:nice The above finds row #1 because row #1's contributor_data structure contains elements that have a location of TX along with tags of nice. Essentially, it found row #1 because "John Doe" matched "TX" and "Jane Doe" matched "nice". To limit the matching to only evaluate individual elements (rather than across the entire set of elements), use the WITH operator: contributor_data.location:TX WITH contributor_data.tags:nice The above also finds row #1, but behind the scenes it only matched the "Jane Doe" subelement, because it's the only element with a location of "TX" and a tag of "nice". The WITH operator has the same semantics as AND but requires both its left and right sides to be a nested object field reference or a parenthetical boolean expression, and all field references must be against the same nested object.

