ZomboDB also exposes nearly all of Elasticsearch's QueryDSL queries as SQL functions, located in a schema named dsl. These functions all return a zdbquery, and can be composed together to build complex queries. The primary advantages of this API are that these functions are syntax- and type-checked by Postgres, so you'll catch malformed queries sooner. In general, each function models its corresponding Elasticsearch query exactly. Default values are used for arguments in all places where Elasticsearch provides defaults for properties, and arguments are required where Elasticsearch requires the corresponding property. Postgres VARIADIC function arguments are used in most cases where Elasticsearch expects an array of queries or values. They're designed to be used with defaults in the common cases, and then otherwise should be used using Postgres' "named arguments" function call syntax to improve readability. All of the functions are briefly described below, but here's some examples for our "cats and dogs" queries, plus a few more examples. SELECT * FROM table WHERE table ==> dsl.and('cats', 'dogs');
SELECT * FROM table WHERE table ==> dsl.and(dsl.term('zdb_all', 'cats'), dsl.term('zdb_all', 'dogs')); Behind the scenes, ZomboDB is just generating the QueryDSL JSON for you: SELECT dsl.and('cats', 'dogs')::json; must ----------------------------------------------------------------------------------------- {"bool":{"must":[{"query_string":{"query":"cats"}},{"query_string":{"query":"dogs"}}]}} SELECT dsl.and(dsl.term('zdb_all', 'cats'), dsl.term('zdb_all', 'dogs'))::json; must ------------------------------------------------------------------------------------------------- {"bool":{"must":[{"term":{"zdb_all":{"value":"cats"}}},{"term":{"zdb_all":{"value":"dogs"}}}]}} Lets say you want to find all rows that contain cats with an age greater than 3 years. This example shows, with the range() function, using Postgres "named arugments" function call syntax so that you can specifiy only the bounds of the range you need. We're also mix-and-matching between the plain text Query String Syntax ('cats') and the builder API (must() and range()): SELECT * FROM table WHERE table ==> dsl.and('cats', dsl.range(field=>'age', gt=>3)); Which rewrites to: SELECT dsl.and('cats', dsl.range(field=>'age', gt=>3))::json; must ------------------------------------------------------------------------------------ {"bool":{"must":[{"query_string":{"query":"cats"}},{"range":{"age":{"gt":"3"}}}]}} One of the more powerful benefits of the Builder API is that it allows you to generate Postgres prepared statements for your text-search queries. For example: PREPARE example AS SELECT * FROM table WHERE table ==> dsl.and($1, dsl.range(field=>'age', gt=>$2)); Now we can execute that query using a different search term and age range: EXECUTE exampe('cats', 3);
EXECUTE exampe('dogs', 7);
EXECUTE exampe('elephants', 23); Using prepared statements is extremely important to avoid SQL-injection attacks. ZomboDB makes this possible for your Elasticsearch QueryDSL query clauses too. Any argument to any of the functions can become a prepared statement arugment that you can change at EXECUTE time.

