dsl.limit() FUNCTION dsl.limit( limit bigint, query zdbquery
) RETURNS zdbquery Limits the number of rows returned to the specified limit limit. If the query doesn't otherwise contain a dsl.sort() (see below), then the results returned are first sorted by _score in descending order. This ensures that ZomboDB returns the top scoring documents. dsl.offset() FUNCTION dsl.offset( offset bigint, query zdbquery
) RETURNS zdbquery Similar to the SQL OFFSET clause, allows you to start returning results from a point other than the start. dsl.sort() FUNCTION dsl.sort( sort_field text, sort_direction dsl.es_sort_directions, -- one of 'asc' or 'desc' query zdbquery
) RETURNS zdbquery Sort the results returned from Elasticsearch by an arbitrary field. Because the SQL standard doesn't guarantee result ordering unless the query contains an ORDER BY clause, you should use ORDER BY in conjunction with this function. For example: SELECT * FROM table WHERE table ==> dsl.sort('id', 'asc', 'cats AND dogs') ORDER BY id asc; In practice, using dsl.sort() only makes sense when combined with dsl.limit(). There's an overloaded version of dsl.sort() (described below) that allows for more complex sorting descriptors. dsl.sd() FUNCTION dsl.sd( field text, "order" dsl.es_sort_directions, mode dsl.es_sort_modes DEFAULT NULL
) RETURNS dsl.es_sort_descriptor dsl.sd() (which is short for "sort descriptor") allows you to contruct an object that represents sorting. It is designed to be used as the arguments to dsl.sort_many(zdbquery, VARIADIC dsl.es_sort_descriptor[]) (defined below). The possible values for the mode argument are min, max, sum, avg, and median. These are documented here: https://www.elastic.co/guide/en/elasticsearch/reference/current/search-request-sort.html#_sort_mode_option Example: SELECT * FROM table WHERE table ==> dsl.sort_many(dsl.match_all(), dsl.sd('field', 'asc'), dsl.sd('price', 'desc', 'avg')); dsl.sd_nested() FUNCTION dsl.sd_nested( field text, "order" dsl.es_sort_directions, nested_path text, nested_filter zdbquery DEFAULT NULL, mode dsl.es_sort_modes DEFAULT NULL
) RETURNS dsl.es_sort_descriptor dsl.sd_nested() (which is short for "nested field sort descriptor") allows you to contruct an object that represents sorting for a nested field. It is designed to be used as an argument to dsl.sort_many(zdbquery, VARIADIC dsl.es_sort_descriptor[]) (defined below). The possible values for the mode argument are min, max, sum, avg, and median. These are documented here: https://www.elastic.co/guide/en/elasticsearch/reference/current/search-request-sort.html#_sort_mode_option Example: SELECT * FROM table WHERE table ==> dsl.sort_many(dsl.match_all(), dsl.sd_nested('offer.price', 'asc', 'offer', dsl.match_all(), 'avg'), dsl.sd('id', 'desc', 'avg')); The above would first sort the results by the average value from the nested field offer.price in ascending order, and then by id in descending order. dsl.sort_many() FUNCTION dsl.sort_many( query zdbquery, VARIADIC descriptors dsl.es_sort_descriptor[]
) RETURNS zdbquery This is similar to the dsl.sort() function described above, however it requires the query be the first argument and allows for a variable list of sort descriptors, that should be generated using the dsl.sd() or dsl.sd_nested() functions. Example: SELECT * FROM table WHERE table ==> dsl.sort_many(dsl.match_all(), dsl.sd('field', 'asc'), dsl.sd('price', 'desc', 'avg')); dsl.sort_direct() FUNCTION dsl.sort_direct( sort_json json, query zdbquery
) RETURNS zdbquery This function allows you to specify direct json to describe how Elasticsearch should sort the results. In the Elasticearch _search request body, this is the top-level "sort" property (https://www.elastic.co/guide/en/elasticsearch/reference/5.6/search-request-sort.html#nested-sorting). Example: SELECT * FROM table WHERE table ==> dsl.sort_direct('{ "_script" : { "type" : "number", "script" : { "lang": "painless", "source": "doc[''field_name''].value * params.factor", "params" : { "factor" : 1.1 } }, "order" : "asc" } }', dsl.match_all()); dsl.min_score() FUNCTION dsl.min_score( min_score real, query zdbquery
) RETURNS zdbquery This allows you to specify Elastisearch's min_score search property to ensure documents with a score less than the specified value are excluded from the results.

