dsl.bool() FUNCTION dsl.bool( VARIADIC queries dsl.esqdsl_bool_part
) RETURNS zdbquery https://www.elastic.co/guide/en/elasticsearch/reference/current/query-dsl-bool-query.html This function represents the Elasticsearch bool query. It takes one or more "boolean part" queries, which are generated using the SQL functions named dsl.must(), dsl.must_not(), dsl.should(), and dsl.filter(). Multiple usages of the same boolean part will be merged together automatically. Example: SELECT dsl.bool( dsl.must('beer', 'wine', 'cheese'), dsl.must_not('beer', 'wine', 'cheese'), dsl.should('beer', 'wine', 'cheese'), dsl.filter('beer', 'wine', 'cheese'), dsl.must('lettuce', 'tomato', 'bread') -- we used dsl.must() above too! ); Which ultimately generates the following Elasticsearch QueryDSL: { "bool": { "filter": [ { "query_string": { "query": "beer" } }, { "query_string": { "query": "wine" } }, { "query_string": { "query": "cheese" } } ], "must": [ { "query_string": { "query": "beer" } }, { "query_string": { "query": "wine" } }, { "query_string": { "query": "cheese" } }, { "query_string": { "query": "lettuce" } }, { "query_string": { "query": "tomato" } }, { "query_string": { "query": "bread" } } ], "must_not": [ { "query_string": { "query": "beer" } }, { "query_string": { "query": "wine" } }, { "query_string": { "query": "cheese" } } ], "should": [ { "query_string": { "query": "beer" } }, { "query_string": { "query": "wine" } }, { "query_string": { "query": "cheese" } } ] }
} dsl.must() FUNCTION dsl.must ( VARIADIC queries zdbquery[])
RETURNS dsl.esqdsl_must https://www.elastic.co/guide/en/elasticsearch/reference/current/query-dsl-bool-query.html This is the must clause of the Elasticsearch QueryDSL bool query. The queries must appear in matching documents and will contribute to the score. This function is designed to be used with the must argument of dsl.bool(). Its arguments can be or or more of any of ZomboDB's dsl functions that return a type of zdbquery. dsl.must_not() FUNCTION dsl.must_not ( VARIADIC queries zdbquery[])
RETURNS dsl.esqdsl_must_not https://www.elastic.co/guide/en/elasticsearch/reference/current/query-dsl-bool-query.html This is the must_not clause of the Elasticsearch QueryDSL bool query. The queries must not appear in the matching documents. Clauses are executed in filter context meaning that scoring is ignored and clauses are considered for caching. Because scoring is ignored, a score of 0 for all documents is returned. This function is designed to be used with the must_not argument of dsl.bool(). Its arguments can be or or more of any of ZomboDB's dsl functions that return a type of zdbquery. dsl.should() FUNCTION dsl.should ( VARIADIC queries zdbquery[])
RETURNS dsl.esqdsl_should https://www.elastic.co/guide/en/elasticsearch/reference/current/query-dsl-bool-query.html This is the should clause of the Elasticsearch QueryDSL bool query. The queries should appear in matching documents and will contribute to the score. This function is designed to be used with the should argument of dsl.bool(). Its arguments can be or or more of any of ZomboDB's dsl functions that return a type of zdbquery. dsl.filter() FUNCTION dsl.filter ( VARIADIC queries zdbquery[])
RETURNS dsl.esqdsl_filter https://www.elastic.co/guide/en/elasticsearch/reference/current/query-dsl-bool-query.html This is the filter object of an Elasticsearch QueryDSL bool. The clause (query) must appear in matching documents. However unlike must the score of the query will be ignored. Filter clauses are executed in filter context, meaning that scoring is ignored and clauses are considered for caching. This function is designed to be used with the filter argument of dsl.bool(). Its arguments can be or or more of any of ZomboDB's dsl functions that return a type of zdbquery.

