Similar to scoring support , ZomboDB can returning highlighted fragments from fields that support it (typically text fields that use an analyzer). The function is called zdb.highlight(tid, fieldname [, json_highlight_descriptor]) RETURNS text[]. Using the tutorial database, an example of highlighting is: tutorial=# SELECT zdb.score(ctid), zdb.highlight(ctid, 'long_description'), long_description FROM products WHERE products ==> 'wooden person' ORDER BY score desc; score | highlight | long_description ----------+--------------------------------------------------------------------------------------------------+------------------------------------------------------------------------------------ 0.882384 | {"Throw it at a <em>person</em> with a big <em>wooden</em> stick and hope they don't hit it"} | Throw it at a person with a big wooden stick and hope they don't hit it 0.224636 | {"A <em>wooden</em> container that will eventually rot away. Put stuff it in (but not a cat)."} | A wooden container that will eventually rot away. Put stuff it in (but not a cat).
(2 rows) Similarly to zdb.score(), the first argument to zdb.highlight() is the Postgres hidden system column ctid that identifies the row for which you want highlights. As Elasticsearch can return multiple highlight fragments for any given field, zdb.highlight() returns a text[] which allows you to address each fragment individually. ZomboDB uses Elasticsearch's defaults for highlighting, but if these are not sufficient for your needs, the third argument to zdb.highlight() allows you to set a per-field highlight definition as decribed in Elasticsearch's highlighting documentation . ZomboDB provides a type-checked helper function (also named zdb.highlight()) that allows you to build up a highlight definition using SQL. CREATE TYPE esqdsl_highlight_type AS ENUM ('unified', 'plain', 'fvh');
CREATE TYPE esqdsl_fragmenter_type AS ENUM ('simple', 'span');
CREATE TYPE esqdsl_encoder_type AS ENUM ('default', 'html');
