In its basic form, a ZomboDB index is essentially a "covering index" that includes all the columns. Behind the scenes, ZomboDB automatically coverts the row being indexed into JSON because JSON is the format Elasticsearch requires. Knowing this, lets create an index on our products table: tutorial=# CREATE INDEX idxproducts ON products USING zombodb ((products.*)) WITH (url='http://localhost:9200/');
CREATE INDEX
tutorial=# So what we've done is create an index named idxproducts on the products table, we've indicated that we want the index to be of type zombodb (via USING zombodb) as opposed to say "btree" or "gin" or "gist", and that it should index all columns in from the table (via, (products.*)). We've also specified the URL to our Elasticsearch cluster (WITH (url='...')). (a few other index options exist to control the number of Elasticsearch shards and replicas (among other things), but we'll consider those advanced-use features and outside the scope of this document.) When we ran CREATE INDEX not only did we create an index within Postgres, we also created one within Elasticsearch. An Elasticsearch type mapping was automatically generated based on the structure of the products table as well. Lets move on to querying...

